import React from "react";

import "./HornedBeast.css";

export default function HornedBeast({
  title,
  img_url,
  description,
  horns,
  id,
}) {
  return (
    <div className="beast-div">
      <h2>{title}</h2>
      <img className="img" src={(require = { img_url })} alt={title}></img>
      <p>ID = {id}</p>
      <p>{description}</p>
      <p>Horns = {horns}</p>
    </div>
  );
}
